const defaultState = {
  posts: [
    {
      id: 1,
      username: "jackson",
      imageUrl:
        "https://mmc.tirto.id/image/otf/880x495/2020/04/20/dragon_ball_super_key_visual_ratio-16x9.jpg",
      caption: "Black Live Matter",
      comments: [
        {
          username: "kevin",
          comment: "hello",
        },
      ],
    },
    {
      id: 1,
      username: "jackson",
      imageUrl:
        "https://mmc.tirto.id/image/otf/880x495/2020/04/20/dragon_ball_super_key_visual_ratio-16x9.jpg",
      caption: "Black Live Matter",
      comments: [
        {
          username: "kevin",
          comment: "hello",
        },
      ],
    },
  ],
};
export default function reducer(state = defaultState, action) {
  switch (action.type) {
    default:
      return state;
  }
}
